import React from 'react';
import { View, Image, Text, StyleSheet } from 'react-native';


const img = require('../../assets/hd.png')
const Home = () => {
    return (
        <View style={styles.home_container}>
            <Text>Home</Text>
            <Image
                source={{ uri: img.default.src }}
                width={500}
                height={500}
            />
        </View>
    );
}

const styles = StyleSheet.create({
    home_container: {
        width: '100vw',
        minHeight: '40vh',
        backgroundColor: "#fff",
        marginTop: '40px'

    }
})

export default Home;
